  {comment_id: "5313649", shot_id: 61, comment_created_at: "2016-05-31T19:40:34Z", body: "<p>With the risk of breaking the geometry here, a mane would do the job on defining the horse better. So nice though, so fucking nice!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/699278/avatars/normal/7bfd7d1dd5674c19611a4c18d14d6a2f.jpg?1454654151", user_id: "699278", user_name: "Daniel Belu", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 9091, localcommentimage_updated_at: "2016-06-01 00:27:01"},
