  {comment_id: "5313984", shot_id: 67, comment_created_at: "2016-05-31T22:23:25Z", body: "<p>I like this. </p>\n\n<p>What if you made the timer + start + pause into one element?</p>\n\n<p>So you would have one giant circle with a play icon inside it. Only show the pause button while it is playing already. </p>\n\n<p>The first behaviour would still work, but then you would have a much more comfortable area to drag your thumb over the circle to set the time,  and also a more intuitive relation between the timer and the start/pause buttons. </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/795288/avatars/normal/2792f77bf32448508899cca9ebe49780.jpg?1429374473", user_id: "795288", user_name: "Khushnood Qadir", localcommentimage_file_name: "data", localcommentimage_content_type: "image/jpeg", localcommentimage_file_size: 7235, localcommentimage_updated_at: "2016-06-01 07:52:35"},
