  {title: "Tubik Studio | Vinny's Bakery", description: "<p>Hello mates!</p>\n\n<p>One more shot is ready and I would like to share it with Dribbble community. Today I am presenting the design concept of a website for a small bakery selling homemade bread. Here you can see the home page presenting the service, providing the links giving more information about the company and the items it offers as well as links to social accounts. I did my best to activate different techniques of visual perception via headline, images, background and copy block, so that users could get the basic information, immediately and got the warm feeling of freshly baked bread. As usual, I followed the philosophy of minimalism which is user-friendly, attractive and informative.</p>\n\n<p><strong>To share more ideas we get working on design projects and concepts in <a href=\"http://tubikstudio.com\" rel=\"nofollow noreferrer\">Tubik Studio</a>, we regularly update <a href=\"http://tubikstudio.com/blog/\" rel=\"nofollow noreferrer\">Tubik Blog</a> with new articles. The latest one is focused on the aspect of <a href=\"http://tubikstudio.com/landing-page-direct-flight-to-high-conversion/\" rel=\"nofollow noreferrer\">design of efficient landing pages</a>. Welcome to join!</strong></p>\n\n<p><a href=\"https://www.behance.net/Tubik\" rel=\"nofollow noreferrer\">Behance</a> | <a href=\"http://instagram.com/tubikstudio\" rel=\"nofollow noreferrer\">Instagram</a> | <a href=\"https://twitter.com/tubikstudio\" rel=\"nofollow noreferrer\">Twitter</a> | <a href=\"https://www.facebook.com/tubikstudio\" rel=\"nofollow noreferrer\">Facebook</a> | <a href=\"https://plus.google.com/+Tubikstudio\" rel=\"nofollow noreferrer\">Google+</a> | <a href=\"http://tubikstudio.com/\" rel=\"nofollow noreferrer\">Tubik</a></p>", width: "400", height: "300", tags: "[\"black\", \"dark\", \"ecommerce\", \"home\", \"interface\", \"landing\", \"minimal\", \"photo\", \"shop\", \"ui\", \"ux\", \"web\"]", image_url: nil, image_pa