  {title: "Shipp app - Tracking", description: "<p>Have you ever shopped online? Did you remember the excitement when you can't wait the item you just purchased to come but the logistic services doesn't really explain where your item is?</p>\n\n<p>Tracking your item should be fun, with Shipp you can hold and easily manage your package on the fly, yet get a live update about your item.</p>\n\n<p>Key points on UX for the tracking part:\n<br />- Where is my item now? And what is the ETA?\n<br />- Quick history and live update when your item is departed from one point to another checkpoint.\n<br />- Adding a new track should be easy (interaction will be posted tomorrow)</p>\n\n<p>Full project : <a href=\"https://dribbble.com/buditanrim/projects/375567-Shipp\" rel=\"nofollow noreferrer\">Shipp </a>\n<br />________________________________________________\n<br /><a href=\"http://bit.ly/budiiG\" rel=\"nofollow noreferrer\"><strong>Instagram</strong></a> | <a href=\"https://twitter.com/buditanrim\" rel=\"nofollow noreferrer\"><strong>Twitter</strong></a> | <a href=\"http://budicon.buditanrim.co\" rel=\"nofollow noreferrer\"><strong>Budicon</strong></a> | <a href=\"http://chromaicon.com\" rel=\"nofollow noreferrer\"><strong>Chromaicon</strong></a></p>", width: "400", height: "300", tags: "[\"application\", \"ios\", \"iphone\", \"mobile\", \"ui\", \"ux\"]", image_url: nil, image_path: nil, user_id: 100, viewcount: 1810, likes_count: 113, comments_count: 8, attachments_count: 1, rebounds_count: 0, buckets_count: 9, dribbble_id: 2751837, html_url: "https://dribbble.com/shots/2751837-Shipp-app-Tracking", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2751837/buckets", comments_url: "https://api.dribbble.com/v1/shots/2751837/comments", likes_url: "https://api.dribbble.com/v1/shots/2751837/likes", projects_url: "https://api.dribbble.com/v1/shots/2751837/projects", animated: false, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, u